import s from './Friends.module.css';
import { NavLink } from 'react-router-dom';


const Friends = (props) => {
	return (
		<div className={s.friends}>
			<h3 className={s.friends__title}>Friends</h3>
			<div className={s.friends__item}>
				<div className={s.friends__item_avatar}>
					<img src="https://static.thenounproject.com/png/363640-200.png" />
				</div>
				<h4 className={s.friends__item_title}>name</h4>
			</div>
		</div>

	)
}

export default Friends;
